N = length(nums)

consec_avg <- function(lst, N){
    avgs <- c()
    for(i in 0:(length(lst) / N - 1)){
        x = 0
        for(j in 1:N){
            x = x + lst[i*N + j]
        }
        avgs <- append(avgs, x)
    }
    avgs
}

NUM_AVG = 100
NUM_COMP = 100
avgs <- consec_avg(nums, NUM_AVG)
comps <- consec_avg(nums == 100, NUM_COMP)

plot(1:length(nums), nums, ylim=c(0,100))
plot(c(), c(), xlim=c(1,N), ylim=c(0,100))
lines(1:length(avgs) * NUM_AVG, avgs / NUM_AVG, col="red")
lines(1:length(comps) * NUM_COMP, comps * 100 / NUM_COMP, col="blue")

lines(c(0,N), c(90, 90))
lines(c(0,N), c(100, 100))
